import { React, lazy } from "react";
function Card({ details }) {
  const { title, url } = details;
  console.log(details);
  return (
    <div
      style={{
        display: "flex",
        flex: 1,
        justifyContent: "center",
        alignContent: "center",
        // backgroundColor: "blue",
        flexDirection: "column",
        width: "100%",
        alignItems: "center",
      }}
    >
      <div
        style={{
          display: "flex",
          flex: 1,
          justifyContent: "center",
          alignContent: "center",
          border: "1px solid",
          borderRadius: "20px",
          margin: "20px",
          //   backgroundColor: "yellow",
          alignItems: "center",
          width: "60%",
          flexDirection: "column",
        }}
      >
        <h1
          style={{
            display: "flex",
            flex: 1,
            justifyContent: "center",
            alignContent: "center",
            // backgroundColor: "red",
          }}
        >
          {title}
        </h1>
        <img
          loading={lazy}
          src={url}
          style={{ width: "800px", height: "500px", margin: "20px" }}
        />
      </div>
    </div>
  );
}

export default Card;
